import React from 'react'

export default class Mois extends React.Component {
    render () {
        return (
            <div>
                <span>Janvier</span>
                <span>Février</span>
                <span>Mars</span>
                <span>Avril</span>
                <span>Mai</span>
                <span>Juin</span>
                <span>Juillet</span>
                <span>Août</span>
                <span>Septembre</span>
                <span>Octobre</span>
                <span>Novembre</span>
                <span>Décembre</span>
            </div>
        );
    };
};
